import React, {useState} from "react";

function PiePapTijRnd(){

  const [ piePapTijRND, setpiePapTijRND ] = useState({});

  const random = () => {
    const calculo = Math.floor(Math.random());
    setPiePapTijRND(calculo);
  };

  return(
    console.log(piePapTijRND)
  )
};

export default PiePapTijRnd;
